    "contents": "# Kaltura API SDK - Native Client Libraries\n\nWhen developing applications that interact with the Kaltura API, it is best to use a native Client Library.\n\nBelow you can download the Client Library for the programming language of your choice.\n\nPlease note, the client libraries provided here have been generated for version 4.1 of the Kaltura OTT Platform API. Customers are encouraged to verify their platform API version and ensure the use of client libraries that match the version of their platform version for optimal compatibility. If you’re unsure which version to use, please contact your Kaltura Account Manager\n\n## Download Client Archives\n<style>\n.client-lib-link {\n  width: 71px;\n  height: 81px;\n  overflow: hidden;\n  margin-top: 12px;\n  margin-right: 12px;\n  display: inline-block;\n  background-image: url(assets/img/client-libs.png);\n  background-position: -70px;\n}\n</style>\n\n<a class=\"client-lib-link php5\" data-language=\"php5\" href=\"https://tvpapi-us-preprod.ott.kaltura.com/v4_1/clientlibs/php5_26-02-2017.tar.gz\" style=\"background-position: 0px\"></a><a class=\"client-lib-link php53\" data-language=\"php53\" href=\"https://tvpapi-us-preprod.ott.kaltura.com/v4_1/clientlibs/php53_26-02-2017.tar.gz\" style=\"background-position: -71px\"></a><a class=\"client-lib-link php5Zend\" data-language=\"php5Zend\" href=\"https://tvpapi-us-preprod.ott.kaltura.com/v4_1/clientlibs/php5Zend_26-02-2017.tar.gz\" style=\"background-position: -142px\"></a><a class=\"client-lib-link java\" data-language=\"java\" href=\"https://tvpapi-us-preprod.ott.kaltura.com/v4_1/clientlibs/java_26-02-2017.tar.gz\" style=\"background-position: -213px\"></a><a class=\"client-lib-link csharp\" data-language=\"csharp\" href=\"https://tvpapi-us-preprod.ott.kaltura.com/v4_1/clientlibs/csharp_26-02-2017.tar.gz\" style=\"background-position: -284px\"></a><a class=\"client-lib-link ruby\" data-language=\"ruby\" href=\"https://tvpapi-us-preprod.ott.kaltura.com/v4_1/clientlibs/ruby_26-02-2017.tar.gz\" style=\"background-position: -355px\"></a><a class=\"client-lib-link python\" data-language=\"python\" href=\"https://tvpapi-us-preprod.ott.kaltura.com/v4_1/clientlibs/python_26-02-2017.tar.gz\" style=\"background-position: -426px\"></a><a class=\"client-lib-link nodejs\" data-language=\"nodejs\" href=\"https://tvpapi-us-preprod.ott.kaltura.com/v4_1/clientlibs/node_26-02-2017.tar.gz\" style=\"background-position: -497px\"></a><a class=\"client-lib-link ajax\" data-language=\"ajax\" href=\"https://tvpapi-us-preprod.ott.kaltura.com/v4_1/clientlibs/ajax_26-02-2017.tar.gz\" style=\"background-position: -568px\"></a><a class=\"client-lib-link cli\" data-language=\"cli\" href=\"https://tvpapi-us-preprod.ott.kaltura.com/v4_1/clientlibs/cli_26-02-2017.tar.gz\" style=\"background-position: -639px\"></a><a class=\"client-lib-link objc\" data-language=\"objc\" href=\"https://tvpapi-us-preprod.ott.kaltura.com/v4_1/clientlibs/objc_26-02-2017.tar.gz\" style=\"background-position: -710px\"></a><a class=\"client-lib-link android\" data-language=\"android\" href=\"https://tvpapi-us-preprod.ott.kaltura.com/v4_1/clientlibs/android_26-02-2017.tar.gz\" style=\"background-position: -781px\"></a><a class=\"client-lib-link swift\" data-language=\"swift\" href=\"https://tvpapi-us-preprod.ott.kaltura.com/v4_1/clientlibs/swift_26-02-2017.tar.gz\" style=\"background-position: -852px\"></a><a class=\"client-lib-link angular\" data-language=\"angular\" href=\"https://tvpapi-us-preprod.ott.kaltura.com/v4_1/clientlibs/ngx_26-02-2017.tar.gz\" style=\"background-position: -923px\"></a>\n\n<script>\n  window.jquery('.client-lib-link').click(function() {\n    var lang = $(this).attr('data-language');\n    mixpanel.track('client_library', {language: lang});\n  })\n</script>\n\n\n\n## Missing a Language?\nTweet [@Kaltura_API pls add sdk for: [lang]](http://twitter.com/?status=@Kaltura_API%20pls%20add%20sdk%20for%3A%20%5Bprogramming_language%5D)\n\nor [create your own Client Library Generator](http://www.kaltura.org/api-client-library-generator-guide)\n\n"
